import styled from "styled-components";

export const Container = styled.div`
  background: #528124;
  color: #fff;
  height: 100vh;
  display: flex;
  justify-content: center;
  justify-items: center;
  align-content: center;
  align-items: center;

  .rows {
    display: grid;
    grid-template-columns: 1fr 1fr;
  }
`;
